import './App.css';
import React,{ useEffect, useState } from 'react';

function App() {
  const [count,setCount] = useState(0);
  const [count1,setCount1] = useState(0);
  const increment=()=>{
    setCount(count+1);
  }
  const increment1=()=>{
    setCount1(count+1);
  }
  const increment2=()=>{
    setCount2(count+1);
  }

  return (
    <div className="App">
      <h1>Heath Chang</h1>
      <button onClick={increment}> Click {count}</button>
      <button onClick={increment1}> Click {count1}</button>
    </div>
  );
}

export default App;
